
var $ = require('@baidu/Boxjs/dist/utils/_bdboxWrapper')
/**
 * @namespace Bdbox.apad
 */
/**
 * 获取pad版框的版本号
 * @name getVersion
 * @function
 * @memberOf Bdbox.apad
 * @return {String} version 返回框的版本号
 * @version  $Id: getVersion.js 175996 2014-05-16 00:48:03Z wangyongqing01 $
 */
var self = function() {
    var back = 0;

    var str = navigator.userAgent;
    var a;

    if (a = /baiduboxpad\/([\d+.]+)/.exec(str)) {
        back = a[1];
    }
    self = function() {
        return back;
    };
    return back;
};

return self;
